import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the member list to be visible
    await page.waitForSelector('#toggle-member-list');
    await page.click('#toggle-member-list');

    // Take a screenshot after opening the member list
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_member_list_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_member_list_opened.png'));

    // Wait for the member list to load
    await page.waitForSelector('.user-info');

    // Extract member data
    const members = await page.evaluate(() => {
      const userElements = Array.from(document.querySelectorAll('.user-info'));
      return userElements.map(user => {
        const username = user.querySelector('.username')?.innerText;
        const status = user.querySelector('.user-status')?.innerText;
        return { username, status };
      });
    });

    // Take a screenshot after extracting data
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_data_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_data_extracted.png'));

    return {
      success: true,
      action: "Extracted member data from the Discord interface",
      extractedData: { members },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
